import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { LoginModule } from './login/login.module';

const routes: Routes = [
  {
    path:'login', pathMatch:'full', loadChildren: ()=>LoginModule
  },
  {
    path:'',redirectTo:'login',pathMatch:'full'
  },
  {
    path:'sidebar', loadChildren: ()=> import('./components/components.module').then(m =>m.ComponentsModule)
  },
  {
    path:'',redirectTo:'/sidebar', pathMatch:'full'
    // path:'',redirectTo:'/sidebar/dashboard', pathMatch:'full'
  },
  { path: '**', redirectTo: '/sidebar' }
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
